const requestProject = (slug) => {
  return {
    type: REQUEST_PROJECT,
    slug
  };
};

const receiveProject = (slug, project) => {
  return {
    type: RECEIVE_PROJECT,
    slug,
    project
  };
};

const failProject = (slug) => {
  return {
    type: FAIL_PROJECT,
    slug
  };
};